import React from 'react';
import { Text, StyleSheet } from 'react-native';
import colors from "../config/colors";





function H2(props) {
    return (
        
        <Text style={styles.heading2}>{props.children}</Text>

    );
}

function Percent(props) {
    return (
        
        <Text style={styles.percentStyle}>{props.children}</Text>

    );
}

const styles = StyleSheet.create({
    
    heading2:{
            color:colors.black,
            fontFamily: "Montserrat",
            fontStyle: "normal",
            fontWeight: "400",
            fontSize:16,
            justifyContent:"center",
            alignItems:"center",
            margin:5,
          },
          percentStyle:{
            color:colors.black,
            fontFamily: "Montserrat",
            fontStyle: "normal",
            fontWeight: "400",
            fontSize:16,
            justifyContent:"center",
            alignItems:"center",
            margin:5,
          },

    }




)

export {
    Percent,
    H2
};
